const PI = Math.PI;
const PI2 = 2 * PI;
const HALF_PI = PI / 2;
const DEG2RAD = Math.PI / 180;
const RAD2DEG = 1 / DEG2RAD;

export { PI, PI2, HALF_PI, DEG2RAD, RAD2DEG };
